column8:
【特長】<br>薄型のスマートフォンホルダーです。<br>繰り返し使える粘着ゲルパッドを使用しているので、スマートフォンをカンタンにホールドでき、ダッシュボード等に貼り付けて使用できます。<br>粘着ゲルパッドは水洗いすることで粘着力が戻り、繰り返し使用できます。<br>3段階の角度でスマートフォンがホールドできます。<br>プレートを裏返しにすればゲルパッドが隠れてカバンやポケット等に入れて持ち運びも可能です。<br>シリコーン製カバーを装着している場合は、カバーを外した状態でホールドして下さい。<br>スマートフォン本体及びカバーに皮革・生地・塗装・及び装飾物等を表面加工施している場合はホールドしないで下さい。<br><br>【メーカー】<br>ナポレックス<br><br>【品番】<br>Fizz-959<style type="text/css">
